import React from 'react'
import "./App.css"
import ProductCard from './components/ProductCard'

const RandomPrice = () => {
  return (`${Math.round(Math.random() * 1000)}$`)
}

const App = () => {
  return (
    <div>
      <p>Hello, World</p>
      <ProductCard title={'Nonono'} price={RandomPrice()} />
    </div>
  )
}

export default App
